function Counter() {
  const [count, setCount] = useState(0);
  
  // Función manejadora del evento
  const handleIncrement = () => {
    setCount(count + 1);
  };
  
  return (
    <div>
      <p>Contador: {count}</p>
      <button onClick={handleIncrement}>Incrementar</button>
    </div>
  );
}`})})})]}),u.jsxs("div",{children:[u.jsx("h3",{className:"text-xl font-semibold text-slate-800 dark:text-white mb-2",children:"Renderizado Condicional"}),u.jsx("p",{className:"text-slate-600 dark:text-slate-300",children:"El renderizado condicional permite mostrar diferentes elementos o componentes según ciertas condiciones. En React, podemos usar operadores como if, operador ternario (?:), operador lógico (&&), o incluso patrones como el renderizado de rutas condicionales."}),u.jsx("div",{className:"bg-slate-100 dark:bg-slate-700 rounded-lg p-4 mt-3 overflow-x-auto",children:u.jsx("pre",{className:"text-slate-800 dark:text-slate-200 text-sm",children:u.jsx("code",{children:`// Diferentes formas de renderizado condicional
