function LoginForm() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Login con:', username, password);
    // Enviar datos al servidor
  };
  
  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label htmlFor="username">Usuario:</label>
        <input
          id="username"
          type="text"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
        />
      </div>
      <div>
        <label htmlFor="password">Contraseña:</label>
        <input
          id="password"
          type="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
      </div>
      <button type="submit">Iniciar sesión</button>
    </form>
  );
}`})})})]}),u.jsxs("div",{children:[u.jsx("h3",{className:"text-xl font-semibold text-slate-800 dark:text-white mb-2",children:"Routing en React"}),u.jsx("p",{className:"text-slate-600 dark:text-slate-300",children:'El routing en aplicaciones React permite navegar entre diferentes "páginas" sin recargar la aplicación completa. React Router es la biblioteca más popular para implementar routing en aplicaciones React. Permite definir rutas, navegar entre ellas, y manejar parámetros en la URL.'}),u.jsx("div",{className:"bg-slate-100 dark:bg-slate-700 rounded-lg p-4 mt-3 overflow-x-auto",children:u.jsx("pre",{className:"text-slate-800 dark:text-slate-200 text-sm",children:u.jsx("code",{children:`// Configuración básica de React Router
